class Timing {
    constructor() {
        this.startH = 0;
        this.startM = 0;
        this.endH = 0;
        this.endM = 0;
    }

    setTiming = (timing) => {
        this.startH = timing.startH;
        this.startM = timing.startM;
        this.endH = timing.endH;
        this.endM = timing.endM;
    };
}

export default Timing
